import React, { ReactElement } from 'react';


interface PortfolioDetailProps {
    name: string;
    cash?: number;
}

function PortfolioDetails ({ name, cash}: PortfolioDetailProps): ReactElement {
    return (
        <div>
            Your Portfolio: {name} {"\n"}
            <br></br>
            Cash: {cash}
        </div>

    )
}



export default PortfolioDetails;
